

import { SIZE, getEl } from "./globals";

export const B = 20;

export const M_SIZE = SIZE/B;

export const FieldEnum = {
  PATH: 0,
  WALL: 1,
  PLATFORM: 2
}

export function mapContains(i, j) {
  if (i >= M_SIZE) return false;
  if (i < 0) return false;
  if (j >= M_SIZE) return false;
  if (j < 0) return false;
  return true;
}

const map1Img = getEl("mapImg")
export function drawMap1(ctx) {
  ctx.drawImage(map1Img, 0,0, SIZE, SIZE)
}


export function isOnPlatform(field, x, y) {
  return getFieldItem(field, x,y).m == FieldEnum.PLATFORM
}
export function isOnPath(field, x, y) {
  return getFieldItem(field, x,y).m == FieldEnum.PATH
}

function getFieldItem(field, x,y) {
  let i = Math.floor(y/B)
  let j = Math.floor(x/B)
  if (mapContains(i,j)) return field[i][j]
  else  return {"x":0,"y":0,"c":0,"m":1}
}

export function getFieldVector(field, x, y) {
  let vec = {x:0, y:0};
  let i = Math.floor(y/B)
  let j = Math.floor(x/B)
  if (!mapContains(i,j)){ return vec }
  let fieldItem = field[i][j]
  vec.x = fieldItem.x
  vec.y = fieldItem.y
  // if (fieldItem.m === FieldEnum.PATH) {
  //   vec = field[i][j];
  // } else { //push away from wall
  //   vec = {
  //     x: x - (B*j + B/2),
  //     y: y - (B*i + B/2)
  //   }
  // }
  // if (fieldItem.m !== FieldEnum.PATH) {
  //   vec.x *= (2 + Math.random())
  //   vec.y *= (2 + Math.random())
  //   console.log(vec)
  // }

  return vec;
}

